    riskViewData(val) {
      if(val){
        this.renderTree();
      }
    }
  },
  methods: {
      ...mapMutations("RiskStore", ["setTreeId", "setIndexData"]),
      ...mapActions("RiskStore", [
      "getRiskFactor",
      "getRiskSafeCurve",
      "getRiskData",
    ]),
    fillColor(val, it) {
      if (val) {
        if (val >= 1 && val <= 3) {
          it.style.fill = "#388621";
        } else if (val >= 4 && val <= 6) {
          it.style.fill = "#ffff26";
        } else if (val >= 7 && val <= 9) {
          it.style.fill = "#f28413";
        } else if (val == 10) {
          it.style.fill = "#ff2200";
        }
      } else {
        it.style.fill = "#388621";
        this.tanBoxShow = false;
        this.isShowTooltip1 = false;
        this.isShowTooltip2 = false;
        this.isShowTooltip3 = false;
        // it.style="display:none"
      }
    },
    whichLevel(val) {
      {
        if (val >= 1 && val <= 3) {
          this.riskLevel = "";
          this.riskColor = "#388621";
        } else if (val >= 4 && val <= 6) {
          this.riskLevel = "";
          this.riskColor = "#ffff26";
        } else if (val >= 7 && val <= 9) {
          this.riskLevel = "";
          this.riskColor = "#f28413";
        } else if (val == 10) {
          this.riskLevel = "";
          this.riskColor = "#ff2200";
        }
      }
    },
    //     
    clickRoot(info) {
      const _id=info&&info.id
      if(_id){
        this.setTreeId(_id);
      }
      // console.log(":", info);
    },
    //     
    clickSecond(info) {
      const _id=info&&info.id
      if(_id){
        this.setTreeId(_id);
      }
    },
    //     
    clickThird(info) {
      const _id=info&&info.id
      if(_id){
        this.setTreeId(_id);
      }
    },
    //     
    clickFourth(info) {
      const _id=info&&info.id
      if(_id){
        this.setTreeId(_id);
      }
    },
    //   
