      // link,,
      this.getOtherInfo(this.indexData,this.treeId)

      this.riskInfo = (this.riskViewData && this.riskViewData[0]) || null;
      const args=document.getElementById('myRiskTree').childNodes
      const arrs=Dictionary.toArray(args)
      const newArrs=arrs.filter(k=>k.nodeName!='#text')
      newArrs.forEach((it, index)=>{
        // 1. start
        let data = this.riskInfo;
        let children_f1 = (data && data.children) || null;
        if (data) {
          if (children_f1) {
             const cls=(it.className&&it.className.baseVal)||null
            if (cls=="cls-37") {
              // 
              it.setAttribute("id", `first_branch${index}`);
              let _id = it.attributes.id.value;
              this.nodeRender(it, _id, "first_branch224", data);
              this.nodeRender(it, _id, "first_branch216", data);
              if (it.info) {
                it.onclick = () => {
                  this.clickRoot(it.info);
                };
              }

              const that = this;
              it.onclick = () => {
                this.clickSecond(it.info);
                if(that.clickedIt){
                  that.clickedIt.style.stroke="#fff"
                  that.clickedIt.style.strokeWidth="0"
                  that.clickedIt.style.strokeDasharray="0 0"

                }
                that.clickedIt=it
                that.clickedIt.style.stroke="#fff"
                that.clickedIt.style.strokeWidth="1"
                that.clickedIt.style.strokeDasharray="4 4"
              };
              it.onmouseover = function(e) {
                const ev = e || window.event;
                that.selctedItem = it.info;
                if (it.info && it.info.value) {
                  that.isShowTooltip1 = true;
                }
                that.frameTop = ev.clientY - 150 + "px";
                that.frameLeft = ev.clientX + 5 + "px";
                if (it.info) {
                  that.whichLevel(it.info.value);
                }
                this.onmousemove = function(e1) {
                  const ev1 = e1 || window.event;
                  that.frameTop = ev1.clientY - 150 + "px";
                  that.frameLeft = ev1.clientX + 5 + "px";
                };
                this.onmouseout = function(e2) {
                  that.isShowTooltip1 = false;
                };
              };
            } else if (cls=="cls-38") {
              // 
              it.setAttribute("id", `second_branch${index}`);
              let _id = (it.attributes.id && it.attributes.id.value) || null;

              let children_f1_x1_json = (children_f1.find(it => it.name === ""))||null;
              this.nodeRender(it, _id, "second_branch233", children_f1_x1_json);

              let children_f1_x2_json = (children_f1.find(it => it.name === ""))||null;
              this.nodeRender(it, _id, "second_branch229", children_f1_x2_json);

